import React from 'react';

const MiniPost = ({ title, date, authorImg, imgUrl }) => {
  return (
    <article className="mini-post">
      <header>
        <h3><a href="single.html">{title}</a></h3>
        <time className="published" dateTime="2015-10-20">{date}</time>
        <a href="#" className="author"><img src={authorImg} alt="" /></a>
      </header>
      <a href="single.html" className="image"><img src={imgUrl} alt="" /></a>
    </article>
  );
};

export default MiniPost;
